import { Component } from '@angular/core';
import { ProductModel } from 'src/app/Navigation/carousel-builder/product.model';
import { mock_list } from 'src/app/Navigation/carousel-builder/mock_list';

@Component({
  selector: 'app-homepage',
  templateUrl: './homepage.component.html',
  styleUrls: ['./homepage.component.css']
})
export class HomepageComponent {
    title = 'Sheetz';
    products: ProductModel []=[];
    constructor(){
      for(var item of mock_list){
        console.log(item);
        this.products.push(item);
      }
    }
  }

<!-- Middle Icon Card -->
<app-middle-icon-card></app-middle-icon-card>
<!-- Carousel Builder -->
<div class="container-fluid d-flex">
    <div id="parent"><
            <app-carousel-builder imgOne={{item.imgOne}} imgDescrOne={{item.imgDescrOne}} imgTwo={{item.imgTwo}} imgDescrTwo={{item.imgDescrTwo}} imgThree={{item.imgThree}} imgDescrThree={{item.imgDescrThree}} ></app-carousel-builder>

    <div *ngFor="let item of products">
    <app-carousel-builder></app-carousel-builder>


</div>
</div></div>
<!-- Bottom Carousel inside of a Card -->
<app-bottom-carousel-card></app-bottom-carousel-card>
<!-- Search Bar -->
<app-search></app-search>
